export default function AdminDashboard({ orders }) {
  return (
    <div className="bg-white p-4 rounded shadow mb-6">
      <h2 className="font-bold text-orange-600 mb-3">Admin Orders Dashboard</h2>
      {orders.map(o=>(
        <div key={o.id} className="border-b py-1">
          {o.user} • {o.item} • {o.status}
        </div>
      ))}
    </div>
  );
}
